import AddRoundedIcon from '@mui/icons-material/AddRounded';
import Button from "@mui/material/Button";

export const CreateNewRecipe = () => {
    return (
        <div style={{ 
            marginTop: '24px',
            display: 'flex',
        }}>
            <h4>Add new recipe</h4>
            <Button 
                style={{
                    borderRadius: 50,
                    marginLeft: '12px',
                    borderColor: "#000000",
                    color: '#000000',
                }}
                variant="outlined" 
                type="submit"
            >
                <AddRoundedIcon/>
            </Button>
        </div>
    )
}
